import React from 'react';
import UseFetch from 'FetchData';
import useFetch from './FechData';
const Electronics = () => {
   UseEffect(()=>{
      const [data,ispending,error]=useFetch("");
   },[]);
    return ( 
        <div>
           {data&&<p>data</p>}
           {isPending&&<p>Ispending.......</p>}
           {error&&<p>Something went Wrong.......</p>}
        </div>
     );
}
 
export default Electronics;
